import React from 'react';
import { ReactComponent as MilkSvg } from '../components/Milk.svg';

const NotFound = () => (
  <div className="screen-size page center">
    <div>
      <h1>404 Page not found</h1>
      <MilkSvg width="500px" height="500px" />
    </div>
  </div>
);

export default NotFound;
